class AddArticle extends React.Component {

  static  propTypes = {
        title: PropTypes.string.isRequired,
        content: PropTypes.string.isRequired,
        slug: PropTypes.string.isRequired
    };

    constructor(props) {
        super(props);

        this.state = {
            title: props.title || '',
            slug: props.slug || '' ,
            content: props.content || ''
        }
    }



    render() {
        return (
            <div style={styleBody}>
              <form onSubmit={this.onSubmit}>
